  return (
    <div>
      <h2>Which place shall we go?</h2>
      <input
        value={input}
        onChange={(e) => input.target.value}
        type="text"
      ></input>
      <button>Add Place to GO</button>

      <h3>List of To-DOSSSSS</h3>
      {todos.map((todo) => (
        <p>{todo}</p>
      ))}
    </div>
  );
}

export default PlacesToGo;
